import React from 'react'
import DetailedOrderItem from './DetailedOrderItem'

export default function DetailedOrderList({value}) {
    const { cart } = value;
    return (
        <div className="container-fluid">
            {cart.map(item => {
                return <DetailedOrderItem key={item.id} item={item}/>
            })}

        </div>
    )
}
